 /* CREATE TABLE */
CREATE SCHEMA weather
CREATE TABLE IF NOT EXISTS current_weather(
   entity_id                VARCHAR(20) NOT NULL
  ,entity_type              VARCHAR(14) NOT NULL
  ,time_index               TIMESTAMP  NOT NULL
  ,fiware_servicepath       VARCHAR(8) NOT NULL
  ,__original_ngsi_entity__ VARCHAR(4)
  ,interval                 INTEGER  NOT NULL
  ,temperature_2m           NUMERIC(4,1) NOT NULL
  ,windspeed_10m            NUMERIC(4,1) NOT NULL
  ,is_day                   INTEGER  NOT NULL
  ,precipitation            NUMERIC(3,1) NOT NULL
  ,time                     VARCHAR(22) NOT NULL
  ,apparent_temperature     NUMERIC(5,1) NOT NULL
  ,pressure_msl             NUMERIC(6,1) NOT NULL
  ,surface_pressure         NUMERIC(6,1) NOT NULL
  ,windgusts_10m            NUMERIC(4,1) NOT NULL
  ,relativehumidity_2m      INTEGER  NOT NULL
  ,showers                  NUMERIC(3,1) NOT NULL
  ,snowfall                 NUMERIC(4,2) NOT NULL
  ,weathercode              INTEGER  NOT NULL
  ,winddirection_10m        INTEGER  NOT NULL
);

